import React from "react";
import { Link } from "react-router-dom";
import DogCard from "./DogCard";
import "./dogsList.css";

const DogsList = ({ dogs }) => {
  return (
    <div className="dogs-list">
      {dogs.map((dog) => (
        <Link to={`http://localhost:3001/dogs/${dog.id}`} key={dog.id} className="card-link">
          <DogCard dog={dog} />
        </Link>
      ))}
    </div>
  );
};

export default DogsList;
